import React from 'react';
import Layout from '../../components/Layout';
import { Carousel } from 'react-bootstrap';
import florest from "../../components/images/florest.jpg";
import truck from "../../components/images/truck.jpg";

function Home () {

    return(
        <Layout>
            <Carousel>
                <Carousel.Item>
                    <img
                        src={florest}
                        alt="Florest image"
                        className="d-block w-100"
                    />
                    <Carousel.Caption>
                        <h3>First slide</h3>
                        <p>Exemplo texto sdasad asdasd fdsfds sfdfsdfdsfsd</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        src="../../components/images/truck.jpg"
                        alt="Truck image"
                        className="d-block w-100"
                    />
                    <Carousel.Caption>
                        <h3>First slide</h3>
                        <p>Exemplo texto sdasad asdasd fdsfds sfdfsdfdsfsd</p>
                    </Carousel.Caption>
                </Carousel.Item>
            </Carousel>
        </Layout>
    )
}

export default Home;
